    var Address = data[i][2];
    var City = data[i][3];
    var Specialization = data[i][4];
    var Qualification = data[i][5];
    var Insurance = data[i][6];
    var Phone_Number = data[i][7];
    var Email = data[i][8];
    var Reviews = data[i][9];
    var Timing = data[i][10];
    var Website = data[i][11];
    dataToImport[id] = {
      name:Name,
      address:Address,
      city:City,
      specialization:Specialization,
      qualification:Qualification,
      insurance:Insurance,
      phone_number:Phone_Number,
      email:Email,
      review:Reviews,
      timing:Timing,
      website:Website
    };
  }
  var firebaseUrl = "https://drseach-f1f59.firebaseio.com/";
  var base = FirebaseApp.getDatabaseByUrl(firebaseUrl);
  base.setData("", dataToImport);

}
